  \"Vegetation and Resulting Wildlife Response to Water Level Manipulation within
  Shearness Pool\",\n\t\"tracking_summary\": {\n\t\t\"total\": 0,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:58:12.200973\",\n\t\"name\": \"vegetation-and-resulting-wildlife-response-to-water-level-manipulation-within-shearness-po\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Moist soil management within a large freshwater
  impoundment has resulted in changes in dabbling duck utilization. Inventory data
  collected on waterfowl use, water level manipulation, rainfall and annual plant
  communities was examined to determine if correlations could be determined between
  specific environmental parameters and fall waterfowl use. Such correlations would
  be useful in development and refinement of annual water management strategies. In
  particular, information was needed to determine if current strategies should be
  maintained or modified. Data presented illustrates the relative contribution of
  Shearness Pool to the station's objective of providing high quality habitat for
  migrating and wintering waterfowl. Examination of the data suggests that no change
  in the management strategy of this pool iswarranted at this time.\",\n\t\"license_title\":
